angular.module("sortApp",["angularUtils.directives.dirPagination"]).controller("mainController",function(t,a){a.get("./data/tracks.json").then(function(a){t.tracks=a.data,t.addedTracks=[]}),t.removeSong=function(a){t.tracks.splice(t.tracks.indexOf(a),1)},t.addSong=function(a){t.tracks.splice(t.tracks.indexOf(a),1),t.tracks.push(t.addedTracks)},t.sortType="Artist",t.sortReverse=!1});